description:
Cujo 1983

Verenigde Staten
Horror / Thriller
91 minuten

geregisseerd door Lewis Teague
met Dee Wallace-Stone, Danny Pintauro en Daniel Hugh Kelly

Donna Trenton is een gefrustreerde huisvrouw wiens leven overhoop ligt 
sinds haar echtgenoot er achter is gekomen dat ze een relatie heeft met 
een andere man. Brett Camber is een jonge jongen wiens enige vriend de 
Sint Bernard Cujo is, die echter door hondsdolle vleermuizen wordt gebeten. 
Terwijl Vic, de echtgenoot van Donna, weg is voor zaken neemt Donna haar 
zoontje Tad mee naar de auto-garage van de vader van Brett. Ze krijgen autopech 
en komen dan tegenover Cujo te staan. Deze is erg, erg ziek...
